[{"location":"#SignalIndices","page":"Home","title":"SignalIndices","text":"Documentation for SignalIndices.\n\n","category":"section"},{"location":"#SignalIndices._pairwise_idx-Tuple{Any, Any, Any}","page":"Home","title":"SignalIndices._pairwise_idx","text":"n is the number of elements in the INPUT of pairwise diff\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.bin_bounds","page":"Home","title":"SignalIndices.bin_bounds","text":"Find the indices to select all points in a bin\n\n\n\n\n\n","category":"function"},{"location":"#SignalIndices.bin_center","page":"Home","title":"SignalIndices.bin_center","text":"Find the center index of a bin\n\n\n\n\n\n","category":"function"},{"location":"#SignalIndices.clip_ndx","page":"Home","title":"SignalIndices.clip_ndx","text":"Clips an index to be within the valid range for an array of length l\n\n\n\n\n\n","category":"function"},{"location":"#SignalIndices.clip_ndx_deviance-Tuple{Any, Any}","page":"Home","title":"SignalIndices.clip_ndx_deviance","text":"clip_ndx but also return deviance\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.copy_length_check","page":"Home","title":"SignalIndices.copy_length_check","text":"copylengthcheck returns true if dest can accept all data from source\n\n\n\n\n\n","category":"function"},{"location":"#SignalIndices.filter_no_collisions-Tuple{Any, Any, Any}","page":"Home","title":"SignalIndices.filter_no_collisions","text":"filter_no_collisions(as, bs, coll_rad)\n\nFilter elements of as to keep elements that are not within coll_rad of any element in bs. Assumes both are sorted.\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.filtermap-Tuple{Function, Function, AbstractVector}","page":"Home","title":"SignalIndices.filtermap","text":"filtermap(p::Function, f::Function, xs)\n\nFilters the input vector, then maps the remaining values. For each element of xs which predicate function p returns true for, use mapping function f to transform the result.\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.find_closest","page":"Home","title":"SignalIndices.find_closest","text":"find_closest(a, target, ...)\n\nFind the index of the element in a that minimizes the absolute difference from the target.\n\n\n\n\n\n","category":"function"},{"location":"#SignalIndices.find_not_unique-Union{Tuple{AbstractArray{T}}, Tuple{T}} where T","page":"Home","title":"SignalIndices.find_not_unique","text":"find_not_unique(a::AbstractArray)\n\nReturns the indices of all redundant elements in a. The time a value is seen, it is not considered redundant\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.glhist!-Tuple{Any, Any, Any}","page":"Home","title":"SignalIndices.glhist!","text":"glhist!(cnts, xs, r)\n\nHistogram, left inclusive. Assumes regular bin size.\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.glhist-Union{Tuple{T}, Tuple{Type{T}, Any, Any}} where T","page":"Home","title":"SignalIndices.glhist","text":"glhist([::Type{T} = Int,] xs, r) where T\n\nLike glhist!.\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.moving_sum!-Tuple{Any, Any, Any}","page":"Home","title":"SignalIndices.moving_sum!","text":"moving_sum!(out, s, nav)\n\nSum s in a sliding window of nav points, placing the result into out. The length of out should be max(length(s) - nav + 1, 0) if nav > 0, or length(s) otherwise.\n\nDoes not zero-pad.\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.moving_sum-Tuple{AbstractVector, Integer}","page":"Home","title":"SignalIndices.moving_sum","text":"moving_sum(s, nav)\n\nSame as moving_sum!, but returns a new array.\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.n_ndx-Union{Tuple{T}, Tuple{T, T}} where T<:Integer","page":"Home","title":"SignalIndices.n_ndx","text":"n_ndx(start_idx::T, stop_idx::T) where {T<:Integer}\n\nFind the number of indices between start_idx and stop_idx.\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.ndx_offset-Union{Tuple{T}, Tuple{T, T}} where T<:Integer","page":"Home","title":"SignalIndices.ndx_offset","text":"ndx_offset(start_ndx, npt)\n\nFinds the index that will select npt number of elements starting at start_ndx.\n\nIf npt is negative, then start_ndx is treated like the end of a range of elements, and the index required to return npt number of elements is returned.\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.ndx_to_t","page":"Home","title":"SignalIndices.ndx_to_t","text":"ndx_to_t(i, fs, start_t)\n\nConverts an index to its time in a regularly sampled time series.\n\n\n\n\n\n","category":"function"},{"location":"#SignalIndices.pairwise_idx-Union{Tuple{T}, Tuple{T, T, Any}} where T","page":"Home","title":"SignalIndices.pairwise_idx","text":"n_el is the number of elements in the INPUT to pairwise diff\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.pairwise_idxs-Tuple{Integer}","page":"Home","title":"SignalIndices.pairwise_idxs","text":"pairwise_idxs(n::Integer) -> Vector{NTuple{2, Int}}\n\nReturns the possible combinations of 1:n indices excluding self-pairs. The first index is always greater than the second, allowing for easy subtraction of ordered lists.\n\nExamples\n\njulia> pairwise_idxs(3)\n3-element Vector{Tuple{Int64,Int64}}:\n (2, 1)\n (3, 1)\n (3, 2)\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.skipoftype-Union{Tuple{A}, Tuple{T}, Tuple{Type{T}, A}} where {T, A}","page":"Home","title":"SignalIndices.skipoftype","text":"skipoftype(::Type{T}, itr)\n\nReturn an iterator over the elements in itr skipping values of type T. Use collect to obtain an Array containing the non-T values in itr. Note that even if itr is a multidimensional array, the result will always be a Vector since it is not possible to remove nothings while preserving dimensions of the input.\n\nExamples\n\njulia> sum(SignalIndices.skipoftype(nothing, [1, nothing, 2]))\n3\njulia> collect(SignalIndices.skipoftype(nothing, [1, nothing, 2]))\n2-element Vector{Int64}:\n 1\n 2\njulia> collect(SignalIndices.skipoftype(nothing, [1 nothing; 2 nothing]))\n2-element Vector{Int64}:\n 1\n 2\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.t_sup_to_ndx-Tuple","page":"Home","title":"SignalIndices.t_sup_to_ndx","text":"t_sup_to_ndx()\n\nConverts a time in a regularly sampled time series to the index of the last sample before the specified time.\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.t_to_last_ndx","page":"Home","title":"SignalIndices.t_to_last_ndx","text":"Like ttondx, but returns sample at or before time\n\n\n\n\n\n","category":"function"},{"location":"#SignalIndices.t_to_ndx","page":"Home","title":"SignalIndices.t_to_ndx","text":"t_to_ndx()\n\nConverts a time in a regularly sampled time series to its index. Returns the index of the first sample at or after the time specified\n\n\n\n\n\n","category":"function"},{"location":"#SignalIndices.time_interval","page":"Home","title":"SignalIndices.time_interval","text":"Find the time_interval of a regularly sampled time series\n\n\n\n\n\n","category":"function"},{"location":"#SignalIndices.trailing_zeros_idx-Tuple{Any}","page":"Home","title":"SignalIndices.trailing_zeros_idx","text":"trailing_zeros_idx(arr)\n\nreturn last index that is not zero\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.window_counts-NTuple{4, Any}","page":"Home","title":"SignalIndices.window_counts","text":"window_counts in a certain range`\n\n\n\n\n\n","category":"method"},{"location":"#SignalIndices.window_counts-Tuple{Any, Any}","page":"Home","title":"SignalIndices.window_counts","text":"window_counts(ts, window_dur)\n\nFor each event in ts, count the number of events in ts that are in the range of ts[i] and ts[i] + window_dur. Assumes ts is sorted, and that elements of ts are unique.\n\n\n\n\n\n","category":"method"}]
